import React from 'react';
import { Button, Card, CardHeader, Col, Container, Form, FormInput, Row } from 'shards-react';

const Home = () => {
    return (
        <Container style={{ backgroundColor: '#ededed' }} className="dr-example-container">
            <Row>
                <Col>
                    <Card>
                        <CardHeader>Card header</CardHeader>
                        <Form>
                            <FormInput style={{ marginBottom: 20 }} placeholder="Username" />
                            <Button theme="primary">Secondary</Button>
                        </Form>
                    </Card>
                </Col>
            </Row>
        </Container>
    )
}

export default Home;
